import React, { Component } from 'react';

class LoginForm extends Component {
    state={ }
    async componentDidMount(){
        const response = await fetch('https://192.168.9.253:8181/api/v1/welcome');
        const body = await response.json();
        alert(body);
    }
    clickForgetPass = () => {
        this.props.onClickForgetPass();
    }
    changeEmail = (e) => {
        this.setState({email: e.target.value})
    }
    changePass = (e) => {
        this.setState({pass: e.target.value})
    }
    handleSubmit = () => {
        alert('123');
    }
    render() { 
        return ( 
            <React.Fragment>
                <label>
                    Đăng nhập
                </label>
                <form>
                    <input type='email' placeholder='Email' required autoComplete='on' onChange={this.changeEmail}/>
                    <input type='password' placeholder='Mật khẩu' required autoComplete='on' onChange={this.changePass}/>
                    <button className='submit' type='submit' onSubmit={this.handleSubmit}>Đăng nhập</button>
                    <button onClick={this.clickForgetPass} className='forget-pass'>Quên mật khẩu?</button>
                    <button onClick={this.tes}>Test</button>
                </form>
            </React.Fragment>
         );
    }
}
 
export default LoginForm;
